INSERT INTO `wp_icl_string_translations` VALUES('460', '1009', 'es', '1', 'Las Hovercards ampl&#237;an las im&#225;genes de Gravatar con informaci&#243;n acerca de una persona: nombre, bio, im&#225;genes, informaci&#243;n de contacto, y otros servicios que utiliza como Twitter, Facebook o LinkedIn.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('461', '1011', 'es', '1', 'Las Hovercards ampl&#237;an las im&#225;genes de Gravatar con informaci&#243;n acerca de una persona: nombre, bio, im&#225;genes, informaci&#243;n de contacto y otros servicios.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('462', '1010', 'es', '1', 'Las Hovercards ofrecen una buena soluci&#243;n para mostrar tu perfil en internet y ayudar a los dem&#225;s a encontrar tu blog.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('463', '1120', 'es', '1', '¿Cómo funciona esto?', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('464', '1823', 'es', '1', 'Hola.\n\nSe ha abonado recientemente a una entrada de mi blog. Esto significa que recibirá un correo electrónico cuando se publiquen nuevos comentarios.\n\nPara activar, seleccione confirmar abajo.  Si cree que esto es un error, ignore este mensaje y no lo molestaremos de nuevo.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('465', '1822', 'es', '1', 'Hola.\n\nSe ha abonado recientemente a las entradas de este blog. Esto significa que recibirá cada nueva entrada por correo electrónico.\n\nPara activar, seleccione confirmar abajo. Si cree que esto es un error, ignore este mensaje y no lo molestaremos de nuevo.', NULL, '2015-05-15 22:05:16');
