INSERT INTO `wp_icl_string_translations` VALUES('471', '1240', 'es', '1', 'Indentifica palabras y fráses que pueden ser ignoradas mientras se corrigen tus entradas y páginas:', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('472', '760', 'es', '1', 'Si se dispusieran de nuevas configuraciones, aparecería un enlace a las mismas', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('473', '1593', 'es', '1', 'Si está vacío, intentaremos determinar el tamaño de la imagen.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('474', '942', 'es', '1', 'Si aparecen otros caracteres antes o después de este mensaje, un tema o plugin muestra caracteres adicionales. Pruebe los pasos 2 y 3.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('475', '932', 'es', '1', 'Si nada de esto ayuda a encontrar una solución, <a href=\"#\"> haga clic aquí para ponerse en contacto con el soporte Jetpack</a>. Cuéntenos todo lo que pueda sobre el problema y los pasos que usted ha seguido para tratar de resolverlo, y uno de nuestros Happiness Engineers se pondrá en contacto para ayudar.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('476', '966', 'es', '1', 'Si eres un autor de temas, puedes leer más sobre como añadir soporte para el Scroll Infinito en <a href=\"%1$s\">%1$s</a>.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('477', '1263', 'es', '1', 'Si todavía no tiene una cuenta de WordPress.com, puede registrarse gratis en sólo unos segundos.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('478', '943', 'es', '1', 'Si recibe un mensaje 404, póngase en contacto con su proveedor de alojamiento web. Su seguridad podría estar bloqueando XMLRPC.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('479', '965', 'es', '1', 'Si utilizas<a href=\"%1$s\">WordPress para iOS</a> o <a href=\"%2$s\">WordPress para Android</a>, ahora podrás activar las notificaciones push para los comentarios nuevos, lo cual facilita mantenerte al tanto con tus lectores y moderar los comentarios al instante.', NULL, '2015-05-15 22:05:16');
INSERT INTO `wp_icl_string_translations` VALUES('480', '940', 'es', '1', 'Si su problema es desconocido o causado por un plugin, intente activar Twenty Twelve (el tema por defecto de WordPress). Si esto resuelve el problema, algo en su tema no funciona. Póngase en contacto con el autor del tema y hágaselo saber.', NULL, '2015-05-15 22:05:16');
