INSERT INTO `wp_icl_string_translations` VALUES('533', '977', 'es', '1', 'Jetpack combina el poder de %s y la sencillez de WordPress para darle lo último en plataformas de blogs matemáticas.', NULL, '2015-05-15 22:05:16');
