INSERT INTO `wp_icl_string_translations` VALUES('536', '779', 'es', '1', 'Jetpack no pudo ponerse en contacto con WordPress.com: %s. Esto generalmente significa que algo no está configurado correctamente en su alojamiento web.', NULL, '2015-05-15 22:05:16');
