INSERT INTO `wp_icl_string_translations` VALUES('541', '762', 'es', '1', 'Jetpack ahora incluye Comentarios Jetpack, lo cual permite a sus visitantes a usar sus cuentas de WordPress.com, Twitter o Facebook, al comentar en su sitio. Para activar Comentarios Jetpack, <a href=\"%s\">%s</a>.', NULL, '2015-05-15 22:05:17');
INSERT INTO `wp_icl_string_translations` VALUES('542', '742', 'es', '1', 'Jetpack requiere la versi&#243;n %s de WordPress o posterior', NULL, '2015-05-15 22:05:17');
INSERT INTO `wp_icl_string_translations` VALUES('543', '747', 'es', '1', 'Jetpack es un plugin de WordPress que permite que utilices el inmenso poder de la nube de WordPress.com en tu sitio WordPress.org.', NULL, '2015-05-15 22:05:17');
INSERT INTO `wp_icl_string_translations` VALUES('544', '963', 'es', '1', 'Jetpack intenta coincidir el esquema de colores de su sitio de forma automática, pero permite hacer ajustes manuales en la parte inferior de la página de <a href=\'%s\'>Configuración de Discusiones</a>.', NULL, '2015-05-15 22:05:17');
INSERT INTO `wp_icl_string_translations` VALUES('545', '884', 'es', '1', 'Semanal de Jetpack', NULL, '2015-05-15 22:05:17');
INSERT INTO `wp_icl_string_translations` VALUES('546', '1063', 'es', '1', 'Jetpack le permitirá autorizar a aplicaciones y servicios conectarse de forma segura a su blog y permite utilizar su contenido de nuevas maneras y ofrecerle nuevas funcionalidades.', NULL, '2015-05-15 22:05:17');
INSERT INTO `wp_icl_string_translations` VALUES('547', '1061', 'es', '1', 'Jetpack tomará automáticamente el contenido publicado en su blog o página web y lo compartirá al instante con los servicios de terceros, como motores de búsqueda, lo que aumenta su alcance y tráfico.', NULL, '2015-05-15 22:05:17');
