INSERT INTO `wp_icl_string_translations` VALUES('676', '1101', 'es', '1', 'A nadie le gusta el tiempo de inactividad, esta es la razón por la cual Jetpack Monitor se encarga de mantener las pestañas en tu sitio. Al momento de detectarse la pausa en el servicio, tu recibirás una notificación por correo electrónico avisandote del problema. De esta manera, ¡tu podrás actuar rápidamente y hacer que tu sitio funcione de nuevo!', NULL, '2015-05-15 22:05:18');
