INSERT INTO `wp_icl_string_translations` VALUES('973', '1068', 'es', '1', 'El editor de CSS Personalizado le da la posibilidad de añadir o sustituir el CSS de su tema, a la vez que suministra coloreado de sintaxis, auto-indentación, e inmediato feedback sobre la validez del CSS que esta escribiendo.', NULL, '2015-05-15 22:05:22');
