INSERT INTO `wp_icl_string_translations` VALUES('981', '1945', 'es', '1', 'El plugin VideoPress no a podido comunicar con los servidores de VideoPress. La causa de este error es probablemente un plugin mal configurado. Por favor vuelve a instalar or actualizar el plugin.', NULL, '2015-05-15 22:05:22');
