INSERT INTO `wp_icl_string_translations` VALUES('983', '810', 'es', '1', 'El proceso de autorización ha expirado. Por favor, regrese y vuelva a intentarlo.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('984', '843', 'es', '1', 'La información anterior no es de mi sitio actual. Por favor, desconectar y luego realizar una nueva conexión a WordPress.com para este sitio utilizando mis preferencias actuales.', NULL, '2015-05-15 22:05:22');
