INSERT INTO `wp_icl_string_translations` VALUES('986', '1839', 'es', '1', 'El e-mail que has introducido no es válido, por favor compruébalo e inténtalo de nuevo.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('987', '789', 'es', '1', 'Las caracter&#237;sticas inferiores est&#225;n ahora activas. Haz clic en los botones de aprender m&#225;s para explorar cada caracter&#237;stica.', NULL, '2015-05-15 22:05:22');
