INSERT INTO `wp_icl_string_translations` VALUES('989', '783', 'es', '1', 'Los siguientes módulos han sido activados: %l.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('990', '1026', 'es', '1', 'Los siguientes servicios están disponibles: Twitter, Facebook, Reddit, StumbleUpon, Digg, LinkedIn, Google +1, Print, and Email.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('991', '1025', 'es', '1', 'Los sigiuentes servicos estan incluidos: Twitter, Facebook, Reddit, StumbleUpon, PressThis, Digg, LinkedIn, Google +1, Imprimir, y Correo.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('992', '1884', 'es', '1', 'Esta imagen ayuda a juntar tus estadísticas y <strong> hace que el mundo sea un mejor lugar</strong> pero todavia funcionará cuando está ocultado.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('993', '862', 'es', '1', 'La versi&#243;n antigua se ha desactivado y puede borrarse de tu sitio.', NULL, '2015-05-15 22:05:22');
