INSERT INTO `wp_icl_string_translations` VALUES('995', '1980', 'es', '1', 'El revisor tiene sugerencias para esta entrada. ¿Está seguro de que desea publicarla?\n\nPulse OK para publicar la entrada o Cancelar para ver las sugerencias y editar su entrada.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('996', '1981', 'es', '1', 'El revisor tiene sugerencias para esta entrada. ¿Está seguro de que desea actualizarla?\n\nPulse OK para actualizar la entrada o Cancelar para ver las sugerencias y editar su entrada.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('997', '2001', 'es', '1', 'La configuración de Contenido Destacado se ha movido a <a href=\"%s\">Apariencia &rarr; Personalizar</a>.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('998', '933', 'es', '1', 'Los resultados de las pruebas y cualquier otra información útil de depuración se enviarán al equipo de soporte. No dude en <a href=\"#\">revisar/modificar</a> esta información.', NULL, '2015-05-15 22:05:22');
