INSERT INTO `wp_icl_string_translations` VALUES('1000', '1018', 'es', '1', 'Hay muchos plugins y servicios que ofrecen estad&#237;sticas, pero la cantidad de informaci&#243;n que ofrecen puede ser abrumadora. Las estad&#237;sticas de WordPress.com hacen f&#225;ciles de entender las m&#233;tricas m&#225;s populares gracias a su interfaz clara y atractiva.', NULL, '2015-05-15 22:05:22');
