INSERT INTO `wp_icl_string_translations` VALUES('1002', '968', 'es', '1', 'Hay una actualización disponible para su tema. Es posible que desee comprobar si esta actualización añade soporte para Scroll Infinito, visitando la página de <a href=\"%s\">Actualizaciones WordPress</a>.', NULL, '2015-05-15 22:05:22');
