INSERT INTO `wp_icl_string_translations` VALUES('1011', '1069', 'es', '1', 'Hay un gran posibilidad que los visitantes a tu página estan usando un smartphone, y es importante darles una gran experiencia mientras que leen en la pantalla pequeña.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('1012', '1835', 'es', '1', 'Estos ajustes modifican los correos electrónicos enviados desde tu blog a los seguidores.', NULL, '2015-05-15 22:05:22');
