INSERT INTO `wp_icl_string_translations` VALUES('1014', '980', 'es', '1', 'Esta opción usa la infraestructura de WordPress.com y requiere que tu contenido público se sincronice allí. Si te encuentras con problemas intermitentes que sólo afectan algunas entradas, solicita que se vuelvan a indexar tus entradas.', NULL, '2015-05-15 22:05:22');
