INSERT INTO `wp_icl_string_translations` VALUES('1016', '775', 'es', '1', 'Este módulo solamente puede ser configurado por %s, el usuario que inició la conexión con Jetpack para este sitio.', NULL, '2015-05-15 22:05:22');
