INSERT INTO `wp_icl_string_translations` VALUES('1037', '828', 'es', '1', 'Para activar todas las caracter&#237;sticas de Jetpack necesitas conectar tu sitio a WordPress.com utilizando el bot&#243;n de la derecha. Una vez hayas realizado la conexi&#243;n actviar&#225;s todas las atractivas caracter&#237;sticas listadas abajo.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('1038', '829', 'es', '1', 'Para activar todas las funcionalidades de Jetpack necesitas conectarlo aquí con tu cuenta de WordPress.com. Usa el botón de la derecha para hacerlo.', NULL, '2015-05-15 22:05:22');
