INSERT INTO `wp_icl_string_translations` VALUES('1040', '1012', 'es', '1', 'Para ver las hovercards, mira cualquier art&#237;culo de tu blog que tenga comentarios. Si el comentarista tiene una hovercard asociada a su gravatar, al pasar el rat&#243;n sobre su imagen &#233;sta aparecer&#225;. Para desactivar las hovercards, haz clic en el bot&#243;n superior de Desactivar.', NULL, '2015-05-15 22:05:22');
INSERT INTO `wp_icl_string_translations` VALUES('1041', '1262', 'es', '1', 'Para utilizar Publicar por Correo Electrónico, es necesario vincular tu cuenta %s con su cuenta de WordPress.com.', NULL, '2015-05-15 22:05:23');
