INSERT INTO `wp_icl_string_translations` VALUES('1043', '1017', 'es', '1', 'Para utilizar enlaces cortos, vaya a cualquier entrada ya publicada (o publique algo nuevo). El botón \"Obtener Enlace corto\" será visible bajo el Título de la entrada. Cuando se hace clic en él, aparece un cuadro de diálogo con el enlace corto que puede ser copiado y pegado en Twitter, Facebook o donde quieras.', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1044', '964', 'es', '1', 'Para utilizar el editor de CSS, vaya a Apariencia &#8594; <a href=\"%s\">Editar CSS</a>.', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1045', '961', 'es', '1', 'Para utilizar el widget de subscripción, dirígete a Apariencia &#8594; <a href=\"%s\">Widgets</a>. Arrastra el widget etiquetado como &#8220;Subscripciones a Blog (Jetpack)&#8221; a una de tus barras laterales y configúralo.', NULL, '2015-05-15 22:05:23');
