INSERT INTO `wp_icl_string_translations` VALUES('1116', '1071', 'es', '1', 'Los visitantes que utilizan iPhone, Android, Windows Phone, y otros dispositivos móviles verán automáticamente el tema móvil, con la opción de ver el sitio completo. Puedes activar o desactivar el tema móvil haciendo clic en el botón \"Desactivar\" o \"Activar\" situado arriba.', NULL, '2015-05-15 22:05:23');
