INSERT INTO `wp_icl_string_translations` VALUES('1118', '1401', 'es', '1', '&#161;Atenci&#243;n! &#161;No encontramos el soporte Multibyte!', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1119', '1536', 'es', '1', 'No podemos mostrar entradas para este blog.', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1120', '1535', 'es', '1', 'No es posible cargar la información del blog en este momento.', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1121', '1491', 'es', '1', 'No hemos podido verificar que su servidor está haciendo una solicitud autorizada. Por favor, inténtelo de nuevo, y asegúrese de que no hay nada que interfiera con las peticiones de su servidor con el Servidor de Jetpack.', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1122', '1205', 'es', '1', 'No pudimos encontrar una cuenta con el correo-e <strong><code>%1$s</code></strong> para iniciar sesión. Si aún no tienes una cuenta en <strong>%2$s</strong>, por favor asegúrate que <strong><code>%1$s</code></strong> está configurada como la dirección de correo electrónico, o que se ha conectado a WordPress.com en tu página de perfil.', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1123', '1206', 'es', '1', 'No pudimos encontrar ninguna cuenta para iniciar sesión en <strong>%2$s</strong> que esté vinculada a tu cuenta de WordPress.com. Si ya tienes una cuenta en <strong>%2$s</strong>, por favor asegúrate que se ha conectado a WordPress.com en el perfil de tu página.', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1124', '1214', 'es', '1', '¡Tenemos aplicaciones para <a href=\"%s\">iOS (iPhone, iPad, iPod Touch)</a>, <a href=\"%s\">Android</a>, <a href=\"%s\">BlackBerry</a>, <a href=\"%s\">Windows Phone</a> y muchos <a href=\"%s\">más</a>!', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1125', '1894', 'es', '1', 'No hemos sido capaces de obtener sus estadísticas en este momento. Por favor actualice la página para intentarlo nuevamente.', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1126', '1877', 'es', '1', 'No se pudieron obtener tus estadísticas en este momento. Por favor, vuelva}e a cargar esta página para intentar de nuevo. Si este error persiste, por favor <a href=\"%1$s\">contacta nuestro soporte técnico</a>. En tu informe, por favor incluye la siguiente información.', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1127', '1858', 'es', '1', 'Hemos desactivado esta opción tuya desde que tienes los widgets a pie de página en Apariencia &rarr; Widgets, o porque tu tema no es compatible con la configuración del scroll infinito.', NULL, '2015-05-15 22:05:23');
INSERT INTO `wp_icl_string_translations` VALUES('1128', '1135', 'es', '1', 'Web', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1129', '782', 'es', '1', 'Bienvenidos a <strong>Jetpack %s</strong>!', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1130', '1435', 'es', '1', '¡Bienvenido a Custom CSS!\n\nCSS (Hojas de estilo en cascada) es un tipo de lenguaje de programación que indica al navegador cómo procesar una página web. Puedes eliminar estos comentarios y comenzar con tus personalizaciones.\n\nPor defecto, tu hoja de estilo se cargará después de las hojas de estilo del tema, lo que significa que tus normas pueden prevalecer y anular las reglas CSS del tema. Solo tienes que escribir aquí lo que quieres cambiar, no es necesario copiar todo el contenido de la hoja de estilo de tu tema.', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1131', '1721', 'es', '1', '¡Bienvenido! ¿Listo para publicar tu primera tira? Ya puedes publicar tu comic en tu nuevo sitio. Comience <a href=\"BLOG_URLwp-admin/customize.php#title\">estableciendo el título y el eslogan</a> para explicar a tus lectores de qué se trata. \n\n¿Necesitas más ayuda con la configuración de tu sitio? Echa un vistazo a la guía <a href=\"http://learn.wordpress.com/\">para principiantes</a> en WordPress.com y la <a href=\"http://en.support.wordpress.com/comics/\">guía para comics en WordPress.com</a>. <a href=\"BLOG_URLwp-admin/customize.php#title\">Publica tu primera tira!</a> \n\nCon mucha risa, \nEl Equipo WordPress.com', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1132', '1102', 'es', '1', 'También te avisaremos tan pronto como tu sitio esté funcionando de nuevo, de manera que puedas controlar el tiempo total de inactividad.', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1133', '1143', 'es', '1', '¿Cuál debería ser la línea de asunto?', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1134', '1555', 'es', '1', '¿Qué tamaño del icono?', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1135', '1008', 'es', '1', '&#191;Qu&#233; es una Hovercard?', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1136', '1629', 'es', '1', '¿Qué es un Gravatar?', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1137', '970', 'es', '1', 'Al añadir una galería a tu entrada, ahora tienes la opción de seleccionar un estilo de diseño para sus imágenes. Hemos añadido soporte para galerías Rectangulares, Cuadradas y Circulares. De forma predeterminada, las galerías se continuarán mostrando mediante el diseño de cuadrícula de miniaturas estándar. Para que el diseño rectangular sea el determinado por defecto para todas las galerías de su sitio web, dirigirse a <a href=\"%s\">Ajustes &rarr; Media</a> y marque la casilla junto a \"Mostrar todas las fotos de tu galería en un mosaico.\"', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1138', '1059', 'es', '1', 'Cuando dejan un comentarios, tus lectores también pueden suscribirse a los comentarios de esa entrada para estar al tanto de la conversación.', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1139', '1073', 'es', '1', 'Al escribir contenido de calidad, lo que realmente quieres es que la gente lo descubra, ¿verdad?', NULL, '2015-05-15 22:05:24');
