INSERT INTO `wp_icl_string_translations` VALUES('1148', '1959', 'es', '1', 'Con 1 comentario', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1149', '1067', 'es', '1', 'Cuando se activa el Carrusel, todas las galerías de imágenes que previamente haya agregado a sus entradas y a sus páginas estarán disponibles en pantalla completa. Sus lectores podrán dejar comentarios y acceder a los datos EXIF ​​de cada imagen.', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1150', '1098', 'es', '1', 'Con el Acceso Único de WordPress.com, tus usuarios podrá acceder o registrarse en tu sitio de WordPress con las mismas credenciales que utilizan en WordPress.com. Es seguro y confiable.', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1151', '1006', 'es', '1', 'Con una suscripción mensual, el plugin VaultPress respaldará el contenido de su sitio, los temas y los plugins en tiempo real, así como análisis de seguridad de agresiones y amenazas comunes regularmente.', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1152', '1074', 'es', '1', 'Con el módulo de Scroll Infinito y un tema soportado, eso es exactamente lo que sucede. En lugar de la antigua manera de navegar por una página, desplazándose y haciendo clic en un enlace para ir a la entrada siguiente y esperar la actualización de la página, Scroll Infinito muestra la siguiente serie de entradas de forma automática cuando el lector se aproxima a la parte inferior de la página; más como una aplicación.', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1153', '984', 'es', '1', 'Con el módulo de VideoPress tu puedes cargar videos fácilmente a tu sitio WordPress e insertarlos en tus entradas y páginas. Este módulo requiere una cuenta de WordPress.com con una <a href=\"http://store.wordpress.com/premium-upgrades/videopress/\" target=\"_blank\">suscripción de VideoPress</a> activa.', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1154', '1993', 'es', '1', 'Los \"Me gusta\" de WordPress.com son', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1155', '1208', 'es', '1', 'Acceso Único de WordPress.com', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1156', '849', 'es', '1', 'Estad&#237;sticas de WordPress.com', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1157', '778', 'es', '1', 'WordPress.com tiene problemas ahora mismo y no puede repostar tu Jetpack. Por favor, int&#233;ntalo m&#225;s tarde.', NULL, '2015-05-15 22:05:24');
