INSERT INTO `wp_icl_string_translations` VALUES('1160', '768', 'es', '1', 'Tama&#241;o incorrecto. Parece que Jetpack no est&#225; en forma. &#191;Has perdido peso? Haz clic en &#8220;Conecta con WordPress.com&#8221; de nuevo para ajustar tu Jetpack.', NULL, '2015-05-15 22:05:24');
