INSERT INTO `wp_icl_string_translations` VALUES('1171', '756', 'es', '1', 'Puede activar o desactivar módulos Jetpack individuales para satisfacer sus necesidades.', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1172', '1430', 'es', '1', 'Puedes añadir las siguientes variables a la URL para compartir tu servicio:', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1173', '1095', 'es', '1', 'También puedes ocultar los widgets según la página actual. Por ejemplo, si no deseas que el widget de Archivo aparezca en el página de resultados de búsqueda, elige  \"Ocultar\" and \"Página es la Página de Resultados de Búsqueda.\"', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1174', '962', 'es', '1', 'También puede realizar cambios en su configuración de Suscripción en la parte inferior de la página de <a href=\"%s\">Configuración de Discusiones</a>.', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1175', '1483', 'es', '1', 'Puedes crear una conexión solo para ti mismo o para todos los usuarios de tu blog. Las conexiones compartidas se marcan con el texto (Compartido).', NULL, '2015-05-15 22:05:24');
INSERT INTO `wp_icl_string_translations` VALUES('1176', '954', 'es', '1', 'Puede ver las notificaciones en la Barra de Herramientas <a href=\"%s\">en WordPress.com</a>.', NULL, '2015-05-15 22:05:24');
