INSERT INTO `wp_icl_string_translations` VALUES('1178', '1903', 'es', '1', 'No tiene los <a rel=\"nofollow\" href=\"%s\">niveles de libertad</a> suficientes para ver este video. Apoye el software libre y póngase al día.', NULL, '2015-05-15 22:05:24');
