INSERT INTO `wp_icl_string_translations` VALUES('1186', '1645', 'es', '1', 'Debe estar <a href=\"#\" class=\"jp-carousel-comment-login\">conectado</a> para enviar un comentario.', NULL, '2015-05-15 22:05:24');
